import React from 'react';
import { BrowserRouter as Router, Route, Routes, Redirect } from 'react-router-dom';
import EnterPage from './EnterPage';
import LoginPage from './LoginPage';
import RegisterPage from './RegisterPage';
import ProfilePage from './ProfilePage';
import DriverMapPage from './DriverMapPage';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<EnterPage />} />   {/* Set EnterPage as the default landing page */}
          <Route path="/login" element={<LoginPage />} />
          <Route path="/register" element={<RegisterPage />} />
          <Route path="/profile" element={<ProfilePage />} />
          <Route path="/map" element={<DriverMapPage />} />
          {/* Redirect for backward compatibility or for those who might still navigate to /main explicitly */}
          <Route path="/main" element={<EnterPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
